import os


class HTML:

    def __init__(self, Header, tableStyles={}, trStyles={}, thStyles={}):
        self.tableStyles = HTML._styleConverter(tableStyles)
        trStyles = HTML._styleConverter(trStyles)
        thStyles = HTML._styleConverter(thStyles)
        self.rows = []
        self.Header = f'<tr {trStyles} >'
        for th in Header:
            self.Header += f'\n<th {thStyles} >{th}</th>'
        self.Header += '\n</tr>'

    @staticmethod
    def _styleConverter(styleDict: dict):
        if styleDict == {}:
            return ''
        styles = ''
        for [style, value] in styleDict.items():
            styles += f'{style}: {value};'
        return f'style="{styles}"'

    def addRow(self, row, trStyles={}, tdStyles={}):
        trStyles = HTML._styleConverter(trStyles)
        tdStyles = HTML._styleConverter(tdStyles)
        temp_row = f'\n<tr {trStyles} >'
        for td in row:
            temp_row += f'\n<td {tdStyles} >{td}</td>'
        temp_row += '\n</tr>'
        self.rows.append(temp_row)

    def __str__(self):

        return \
            f'''
<table {self.tableStyles} >
{self.Header}
{''.join(self.rows)}
</table>
'''


async def dictionaryToHTMLTable(dict: dict):
    html = HTML(Header=dict.keys(),
                tableStyles={'margin': '3px'},
                trStyles={'background-color': '#7cc3a97d'},
                thStyles={'color': 'white'})
    for i, row in enumerate(zip(*dict.values())):
        print(row)
        if i % 2 == 0:
            BGC = 'aliceblue'
        else:
            BGC = '#c2d4e4'
        html.addRow(row, trStyles={'background-color': BGC}, tdStyles={'padding': '1rem'})
    return html


async def dictionaryToHTML(a):
    data = ""
    for k in a:
	    data += "<td>" + k + "</td>"
	    for d in a[k]:
	    	data += "<td>" + d + "</td>"
	    data += "<tr>"

    data = "<table border=1>" + data + "<table>"
    print(data)
    with open("file.html", "a") as file:
    	file.write(data)

    os.startfile("file.html")



# write to html
def dictionaryToHTML2(a):
    html = '<html><table border="1"><tr><th>A</th><th>' + '</th><th>'.join(dict(a).keys()) + '</th></tr>'

    for row in zip(*dict(a).values()):
        html += '<tr><td>Object Name</td><td>' + '</td><td>'.join(str(row)) + '</td></tr>'

    html += '</table></html>'

    file_ = open('result.html', 'w')
    file_.write(html)
    file_.close()


